import { ListGroup } from 'react-bootstrap'
import { Card } from '../Card/Card'

export const TableList = props => {
    const tables = props.tables;
    return (
        <ListGroup variant="flush">
            {tables.map(table => 
            <ListGroup.Item 
                className={'px-0 py-4'} 
                key={table.id}>
                <Card key={table.id} table={table}/>
            </ListGroup.Item>)}
        </ListGroup>
    )
}
